import React , { Fragment  , useEffect}  from 'react';
import Alert from '../layout/Alert';
import cookies from 'js-cookie';


const Home = (props) => {

    useEffect(()=>{
        if(cookies.get('userName')==null) {
            props.history.push('/logIn');
        }
    },[props.history]);
  
    return (
        <Fragment>
            <br/><br /><br/>
            <Alert />
            <br/><br /><br/>
            <div className="container">
               
            </div>
        </Fragment>
    )
    
}

export default Home
